import React, { useEffect, useState, useRef } from "react";
import { Toast } from "primereact/toast";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";
import { AutoComplete } from "primereact/autocomplete";
import { Dropdown } from "primereact/dropdown";
import "./App.css";
import "./index.css";
import "./flag.css";

const API_BASE_URL = process.env.REACT_APP_API_URL || "http://localhost:5000";

const Leaderboard = () => {
  const [players, setPlayers] = useState([]);
  const [search, setSearch] = useState("");
  const [selectedCountry, setSelectedCountry] = useState("All");
  const [filteredPlayers, setFilteredPlayers] = useState([]);
  const [suggestions, setSuggestions] = useState([]);
  const toast = useRef(null);

  // ðŸ“Œ API'den veriyi Ã§ek
  useEffect(() => {
    const fetchLeaderboard = async () => {
      try {
        const response = await fetch(`${API_BASE_URL}/leaderboard`);
        if (!response.ok) throw new Error("Failed to fetch leaderboard");

        let data = await response.json();
        console.log("Fetched Data:", data);

        // ðŸ“Œ Ranking (sÄ±ralama) hesapla
        data = data
          .sort((a, b) => b.money - a.money)
          .map((player, index) => ({
            ...player,
            rank: index + 1,
            name: player.name || "Unknown Player",
          }));

        setPlayers(data);
        setFilteredPlayers(data);
      } catch (error) {
        console.error("Fetch error:", error);
        toast.current?.show({
          severity: "error",
          summary: "Error",
          detail: "An error occurred while fetching data.",
        });
      }
    };

    fetchLeaderboard();
  }, []);

  // ðŸ“Œ Search ve Ãœlkeye GÃ¶re Filtreleme
  useEffect(() => {
    let filtered = players;

    if (search.trim()) {
      filtered = filtered.filter((player) =>
        player.name.toLowerCase().includes(search.toLowerCase())
      );
    }

    if (selectedCountry !== "All") {
      filtered = filtered.filter((player) => player.country === selectedCountry);
    }

    setFilteredPlayers(filtered);
  }, [search, selectedCountry, players]);

  // ðŸ“Œ Search Ã¶nerilerini oluÅŸtur
  const onSearchInput = (event) => {
    const query = event.query.toLowerCase();
    setSuggestions(
      players
        .filter((player) => player.name.toLowerCase().includes(query))
        .map((player) => player.name)
    );
  };

  // ðŸ“Œ Ãœlke BayraklarÄ±nÄ± GÃ¶sterme
  const countryBodyTemplate = (rowData) => {
    const countryCode = rowData?.country_code?.toLowerCase();
    return (
      <div className="flex align-items-center gap-2">
        {countryCode ? (
          <img
            alt={countryCode}
            src={`https://flagcdn.com/w40/${countryCode}.png`}
            className="flag"
            style={{ width: "24px", height: "16px" }}
          />
        ) : (
          <span style={{ fontStyle: "italic", color: "gray" }}>No Flag</span>
        )}
        <span>{" " + rowData?.country || "Unknown"}</span>
      </div>
    );
  };

  // ðŸ“Œ Ãœlke seÃ§enekleri
  const countryOptions = ["All", ...new Set(players.map((p) => p.country))];

  return (
    <div className="container">
      <div className="leaderboard-header">
        <h1>Leaderboard</h1>
      </div>

      <div className="filters">
        <AutoComplete
          value={search}
          suggestions={suggestions}
          completeMethod={onSearchInput}
          onChange={(e) => setSearch(e.value)}
          placeholder="Search player..."
          className="p-autocomplete"
        />

        <Dropdown
          value={selectedCountry}
          options={countryOptions.map((c) => ({ label: c, value: c }))}
          onChange={(e) => setSelectedCountry(e.value)}
          placeholder="Filter by Country"
          className="p-dropdown"
        />
      </div>

      {/* ðŸŒŸ DataTable */}
      <div className="table-container">
        <DataTable
          value={filteredPlayers}
          paginator
          rows={10}
          reorderableColumns
          responsiveLayout="scroll"
        >
          <Column field="rank" header="Ranking" sortable />
          <Column field="name" header="Player Name" sortable />
          <Column field="money" header="Money" sortable />
          <Column field="country" header="Country" body={countryBodyTemplate} />
        </DataTable>
      </div>

      <Toast ref={toast} />
    </div>
  );
};

export default Leaderboard;
